pub enum Event<T: Config> {
    SomethingStored(u32, T::AccountId),
    __Ignore(frame_support::sp_std::marker::PhantomData<T>,
             frame_support::Never),
}

pub enum Error<T> {
    __Ignore(frame_support::sp_std::marker::PhantomData<T>,
             frame_support::Never),
    NoneValue,
    StorageOverflow,
}

pub enum Call<T: Config> {
    __Ignore(frame_support::sp_std::marker::PhantomData<(T,)>,
             frame_support::Never),
    do_something(u32),
    cause_error(),
}
